import React from "react";
import './Styles.css';

const Green = () => {
	return (
		<>
		<div className="trafic">
			<div className="lighter red"></div>
			<div className="lighter yellow"></div>
			<div className="lighter green active"></div>
		</div>	
		</>
	)
}

export default Green
